  const [goalsFromAPI, setGoalsFromAPI]= useState([]);
  
  // useEffect(()=>{
  //   console.log(''); 
  // });

  useEffect(()=>{
    fetch ('https://unstats.un.org/SDGAPI/v1/sdg/Goal/List?includechildren=true')
  .then(
    (res)=> {
      return res.json();  
    }
      ).then(
        (data)=>{
          setGoalsFromAPI(data)
        }
      )
  }, )
  
 

  return (
    <div className="App">
     Hej 
    </div>
  );
}

export default App;
